import React from 'react'

export const WeatherMainInfo = ({weather}) => {
  return (
    <div>
        <div>
            {weather?.location.name}
        </div>
        <div>
            {weather?.location.country}
        </div>
        <div>
            <div>
                <img src={`http:${weather?.current.condition.icon}`} width="138" />
            </div>
        </div>
    </div>
  )
}
